import { Component, OnInit } from '@angular/core';
import { Inject} from '@angular/core';
import {MatDialog, MatDialogRef, MAT_DIALOG_DATA} from '@angular/material';

import { GlobalService } from './../../global.service';
import { ViewChild,ElementRef } from '@angular/core';

import {Http, Headers, RequestOptions} from '@angular/http';
import 'rxjs/add/operator/map';import { map } from "rxjs/operators";

@Component({
  selector: 'app-users-add',
  templateUrl: './users-add.component.html',
  styleUrls: ['./users-add.component.css']
})
export class UsersAddComponent implements OnInit {
		temppic
		username=''
		name=''
		acctype=''
		id=""
  constructor(public dialog: MatDialog,public dialogRef: MatDialogRef<UsersAddComponent>,@Inject(MAT_DIALOG_DATA) public data: any,public global: GlobalService,private http: Http) { 
  		}


  ngOnInit() {
  	this.temppic = 'data:image/jpeg;base64,'
  
  	if(this.data.type==1){
  		this.temppic=this.data.data.picture
  		this.username=this.data.data.username
  		this.name=this.data.data.name
  		this.acctype=this.data.data.type
  		this.id=this.data.data.id
  	}
  }
  closedialog(){
       this.dialogRef.close({result:'cancel'}); 
  }
  savedata(){
  	var x = ''
  	if(this.username==''){
  		x=x+"*Username is required!<br>"
  	}
  	if(this.name==''){
  		x=x+"*Name is required!<br>"
  	}
  	if(this.acctype==''){
  		x=x+"*Account type is required!<br>"
  	}

  	if(x==''){
  		var header = new Headers();
                     header.append("Accept", "application/json");
                     header.append("Content-Type", "application/x-www-form-urlencoded");    
              let option = new RequestOptions({ headers: header });
              let urlSearchParams = new URLSearchParams();
                  urlSearchParams.append("pass",'adduser');
                  urlSearchParams.append("username",this.username);
                  urlSearchParams.append("name",this.name);
                  urlSearchParams.append("acctype",this.acctype);
                  urlSearchParams.append("picture",this.temppic);
                    urlSearchParams.append("user",this.global.user.name);
              let body = urlSearchParams.toString()
            this.global.swalloading("")
            this.http.post(this.global.url+'', body,option)
               .map(response => response.json())
              .subscribe(res => {
              	if(res.message=='success'){
              		this.global.swalalert("success","User has been Saved!")
              		this.dialogRef.close({result:'success'}); 
              	}else

              		this.global.swalalert("warning","User Failed to save! Duplicate Username.")
                    //
                  },Error=>{
                    console.log(Error)
                    this.global.swalerror()
                 
                  });
          }else{
          	this.global.swalalert("warning",x)
          }
  }
  updatedata(){
  	var x = ''
  	if(this.username==''){
  		x=x+"*Username is required!<br>"
  	}
  	if(this.name==''){
  		x=x+"*Name is required!<br>"
  	}
  	if(this.acctype==''){
  		x=x+"*Account type is required!<br>"
  	}

  	if(x==''){
  		var header = new Headers();
                     header.append("Accept", "application/json");
                     header.append("Content-Type", "application/x-www-form-urlencoded");    
              let option = new RequestOptions({ headers: header });
              let urlSearchParams = new URLSearchParams();
                  urlSearchParams.append("pass",'updateuser');
                  urlSearchParams.append("username",this.username);
                  urlSearchParams.append("name",this.name);
                  urlSearchParams.append("acctype",this.acctype);
                  urlSearchParams.append("id",this.id);
                    urlSearchParams.append("user",this.global.user.name);
              let body = urlSearchParams.toString()
            this.global.swalloading("")
            this.http.post(this.global.url+'', body,option)
               .map(response => response.json())
              .subscribe(res => {
              	console.log(res)
              	if(res.message=='success'){
              		this.global.swalalert("success","User has been Updated!")
              		this.dialogRef.close({result:'success'}); 
              	}else

              		this.global.swalalert("warning","User Failed to Update! Duplicate Username.")
                    //
                  },Error=>{
                    console.log(Error)
                    this.global.swalerror()
                 
                  });
          }else{
          	this.global.swalalert("warning",x)
          }
  }

}
